import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
    faFacebook,
    faTwitter,
    faInstagram,
} from '@fortawesome/free-brands-svg-icons';

import './Header.css';
export default function Header (){
    return(
        <div className="header-name">
            <h1 className="header-name-title">InstaFill</h1>
            <h1 className="header-name-item">Form Magic!</h1>


            <FontAwesomeIcon className="header-name-title" icon={faTwitter} size='2x' />
            <FontAwesomeIcon className="header-socials-instagram soc" icon={faInstagram} size='2x'/>
            <FontAwesomeIcon className="header-socials-facebook soc" icon={faFacebook} size='2x'/>
        </div>
        
    )
}
